const BusinessSolution = () => {
  return (
    <div className="bg-[#0048620d]">
      <div className="container-class py-[100px]">
        <div>
          <div className="w-[510px]">
            <h2 className="text-[#222] text-[40px] font-medium">
              We provide the best solution for your business development
              <span className="text-[#00D588]">.</span>
            </h2>
          </div>
          <div>
            <p className="text-[#222] w-[510px] pt-[20px] text-[18px] font-light">A one stop shop for Construction Companies to manage their invoice process.</p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default BusinessSolution;
